@pytest.mark.slow
class TestFlowdriverFlowApiCalls(TestCase):
    api = FlowdriverApi
    addresses = ['f919ee77447b7497',
                 '0x6c36d50dd512ef8e',
                 'ecfad18ba9582d4f']
    txs_hash = ['c7851221b77faa84c78fabbb237c3de7f38b49d1f08880b2bcaca9976649e331',
                'c3105df17a70fdf075e411e3377867668fb0c94044dbd18d56f9338ec0449d61',
                '73603f93e5081ba05ee1cd319e9ce410898f19e9972f2b71641f04338a5d5546'
                ]

    @classmethod
    def check_general_response(cls, response, keys):
        if set(response.keys()).issubset(keys):
            return True
        return False

    def test_get_tx_details_api(self):
        tx_details_keys = {'id', 'timestamp', 'payer', 'authorizers', 'gas_used', 'fee', 'status', 'block_height',
                           'error', '__typename', 'block_id','proposer',
                           'events'}
        event_keys = {'name', 'fields', '__typename'}
        for tx_hash in self.txs_hash:
            get_tx_details_response = self.api.get_tx_details(tx_hash)
            assert (get_tx_details_response.get('data') and isinstance(get_tx_details_response.get('data'), dict))
            assert (get_tx_details_response.get('data').get('transactions') and isinstance(
                get_tx_details_response.get('data').get('transactions'), list))
            transaction = get_tx_details_response.get('data').get('transactions')[0]
            assert self.check_general_response(transaction, tx_details_keys)
            if transaction.get('events') and isinstance(transaction.get('events'), list):
                for event in transaction.get('events'):
                    assert (self.check_general_response(event, event_keys) and len(event) > 0)

    def test_get_address_txs_api(self):
        address_txs_keys = {'roles', 'transaction', '__typename'}
        transaction_keys = {'id', 'timestamp', 'payer', 'authorizers', 'gas_used', 'fee', 'status', 'block_height',
                            'block_id', 'error', '__typename',
                            'events'
                            }
        event_keys = {'id', 'name', 'fields', '__typename'}
        for address in self.addresses:
            get_address_txs_response = self.api.get_address_txs(address)
            if get_address_txs_response.get('data') and get_address_txs_response.get('data').get('participations'):
                transactions = get_address_txs_response.get('data').get('participations')
                for transaction in transactions:
                    assert self.check_general_response(transaction, address_txs_keys)
                    assert self.check_general_response(transaction.get('transaction'), transaction_keys)
                    if transaction.get('transaction').get('events') and isinstance(transaction.get('transaction').get('events'), list):
                        for event in transaction.get('transaction').get('events'):
                            assert (self.check_general_response(event, event_keys) and len(event) > 0)


